import React from 'react';
import Employee from './components/Employee';

const Employees = [
    {
        name: "miroj",
        position: "CEO",
    },
    {
        name: "binamra",
        postion : "Peon",
    },
    {
        name: "anish",
        position : "water boy",
    }
];

function Test()
{
    return(
        <div className= "employees">
        {
            Employees.map((employee) => (<div>
                <h3>{`name : ${employee.name}`}</h3>
                <h5>{`name : ${employee.position}`}</h5>
            </div>))
        }
        </div>
    )
}
export default Test;
